SYNOPSIS","  PowerShell adaptation of WinPEAS.exe / WinPeas.bat",".DESCRIPTION","  For the legal enumeration of windows based computers that you either own or are approved to run this script on",".EXAMPLE","  # Default - normal operation with username/password audit in drives/registry","  .\\winPeas.ps1","","  # Include Excel files in search: .xls, .xlsx, .xlsm","  .\\winPeas.ps1 -Excel","","  # Full audit - normal operation with APIs / Keys / Tokens","  ## This will produce false positives ## ","  .\\winPeas.ps1 -FullCheck ","","  # Add Time stamps to each command","  .\\winPeas.ps1 -TimeStamp","",".NOTES","  Version:                    1.3","  PEASS-ng Original Author:   carlospolop","  winPEAS.ps1 Author:         @RandolphConley","  Creation Date:              10/4/2022","  Website:                    https://github.com/carlospolop/PEASS-ng","","  TESTED: PoSh 5,7","  UNTESTED: PoSh 3,4","  NOT FULLY COMPATIBLE: PoSh 2 or lower","#>","","######################## FUNCTIONS ########################","","[CmdletBinding()]","param(","  [switch]$TimeStamp,","  [switch]$FullCheck,","  [switch]$Excel",")","","# Gather KB from all patches installed","function returnHotFixID {","  param(","    [string]$title","  )","  # Match on KB or if patch does not have a KB, return end result","  if (($title | Select-String -AllMatches -Pattern 'KB(\\d{4,6})').Matches.Value) {","    return (($title | Select-String -AllMatches -Pattern 'KB(\\d{4,6})').Matches.Value)","  }","  elseif (($title | Select-String -NotMatch -Pattern 'KB(\\d{4,6})').Matches.Value) {","    return (($title | Select-String -NotMatch -Pattern 'KB(\\d{4,6})').Matches.Value)","  }","}","","Function Start-ACLCheck {","  param(","    $Target, $ServiceName)","  # Gather ACL of object","  if ($null -ne $target) {","    try {","      $ACLObject = Get-Acl $target -ErrorAction SilentlyContinue","    }","    catch { $null }","    ","    # If Found, Evaluate Permissions","    if ($ACLObject) { ","      $Identity = @()","      $Identity += \"$env:COMPUTERNAME\\$env:USERNAME\"","      if ($ACLObject.Owner -like $Identity ) { Write-Host \"$Identity has ownership of $Target\" -ForegroundColor Red }","      whoami.exe /groups /fo csv | ConvertFrom-Csv | Select-Object -ExpandProperty 'group name' | ForEach-Object { $Identity += $_ }","      $IdentityFound = $false","      foreach ($i in $Identity) {","        $permission = $ACLObject.Access | Where-Object { $_.IdentityReference -like $i }","        $UserPermission = \"\"","        switch -WildCard ($Permission.FileSystemRights) {","          \"FullControl\" { $userPermission = \"FullControl\"; $IdentityFound = $true }","          \"Write*\" { $userPermission = \"Write\"; $IdentityFound = $true }","          \"Modify\" { $userPermission = \"Modify\"; $IdentityFound = $true }","        }","        Switch ($permission.RegistryRights) {","          \"FullControl\" { $userPermission = \"FullControl\"; $IdentityFound = $true }","        }","        if ($UserPermission) {","          if ($ServiceName) { Write-Host \"$ServiceName found with permissions issue:\" -ForegroundColor Red }","          Write-Host -ForegroundColor red  \"Identity $($permission.IdentityReference) has '$userPermission' perms for $Target\"","        }","      }    ","      # Identity Found Check - If False, loop through and stop at root of drive","      if ($IdentityFound -eq $false) {","        if ($Target.Length -gt 3) {","          $Target = Split-Path $Target","          Start-ACLCheck $Target -ServiceName $ServiceName","        }","      }","    }","    else {","      # If not found, split path one level and Check again","      $Target = Split-Path $Target","      Start-ACLCheck $Target $ServiceName","    }","  }","}","","Function UnquotedServicePathCheck {","  Write-Host \"Fetching the list of services, this may take a while...\";","  $services = Get-WmiObject -Class Win32_Service | Where-Object { $_.PathName -inotmatch \"`\"\" -and $_.PathName -inotmatch \":\\\\Windows\\\\\" -and ($_.StartMode -eq \"Auto\" -or $_.StartMode -eq \"Manual\") -and ($_.State -eq \"Running\" -or $_.State -eq \"Stopped\") };","  if ($($services | Measure-Object).Count -lt 1) {","    Write-Host \"No unquoted service paths were found\";","  }","  else {","    $services | ForEach-Object {","      Write-Host \"Unquoted Service Path found!\" -ForegroundColor red","      Write-Host Name: $_.Name","      Write-Host PathName: $_.PathName","      Write-Host StartName: $_.StartName ","      Write-Host StartMode: $_.StartMode","      Write-Host Running: $_.State","    } ","  }","}","","function TimeElapsed { Write-Host \"Time Running: $($stopwatch.Elapsed.Minutes):$($stopwatch.Elapsed.Seconds)\" }","Function Get-ClipBoardText {","  Add-Type -AssemblyName PresentationCore","  $text = [Windows.Clipboard]::GetText()","  if ($text) {","    Write-Host \"\"","    if ($TimeStamp) { TimeElapsed }","    Write-Host -ForegroundColor Blue \"=========|| ClipBoard text found:\"","    Write-Host $text","    ","  }","}","","Function Search-Excel {","  [cmdletbinding()]","  Param (","      [parameter(Mandatory, ValueFromPipeline)]","      [ValidateScript({","          Try {","              If (Test-Path -Path $_) {$True}","              Else {Throw \"$($_) is not a valid path!\"}","          }","          Catch {","              Throw $_","          }","      })]","      [string]$Source,","      [parameter(Mandatory)]","      [string]$SearchText","      #You can specify wildcard characters (*, ?)","  )","  $Excel = New-Object -ComObject Excel.Application","  Try {","      $Source = Convert-Path $Source","  }","  Catch {","      Write-Warning \"Unable locate full path of $($Source)\"","      BREAK","  }","  $Workbook = $Excel.Workbooks.Open($Source)","  ForEach ($Worksheet in @($Workbook.Sheets)) {","      # Find Method https://msdn.microsoft.com/en-us/vba/excel-vba/articles/range-find-method-excel","      $Found = $WorkSheet.Cells.Find($SearchText)","      If ($Found) {","        try{  ","          # Address Method https://msdn.microsoft.com/en-us/vba/excel-vba/articles/range-address-property-excel","          Write-Host \"Pattern: '$SearchText' found in $source\" -ForegroundColor Blue","          $BeginAddress = $Found.Address(0,0,1,1)","          #Initial Found Cell","          [pscustomobject]@{","              WorkSheet = $Worksheet.Name","              Column = $Found.Column","              Row =$Found.Row","              TextMatch = $Found.Text","              Address = $BeginAddress","          }","          Do {","              $Found = $WorkSheet.Cells.FindNext($Found)","              $Address = $Found.Address(0,0,1,1)","              If ($Address -eq $BeginAddress) {","                Write-host \"Address is same as Begin Address\"","                  BREAK","              }","              [pscustomobject]@{","                  WorkSheet = $Worksheet.Name","                  Column = $Found.Column","                  Row =$Found.Row","                  TextMatch = $Found.Text","                  Address = $Address","              }                 ","          } Until ($False)","        }","        catch {","          # Null expression in Found","        }","      }","      #Else {","      #    Write-Warning \"[$($WorkSheet.Name)] Nothing Found!\"","      #}","  }","  try{","  $workbook.close($False)","  [void][System.Runtime.InteropServices.Marshal]::ReleaseComObject([System.__ComObject]$excel)","  [gc]::Collect()","  [gc]::WaitForPendingFinalizers()","  }","  catch{","    #Usually an RPC error","  }","  Remove-Variable excel -ErrorAction SilentlyContinue","}","","function Write-Color([String[]]$Text, [ConsoleColor[]]$Color) {","  for ($i = 0; $i -lt $Text.Length; $i++) {","    Write-Host $Text[$i] -Foreground $Color[$i] -NoNewline","  }","  Write-Host","}","","#Write-Color \"    ((,.,/((((((((((((((((((((/,  */\" -Color Green","Write-Color \",/*,..*(((((((((((((((((((((((((((((((((,\" -Color Green","Write-Color \",*/((((((((((((