istry Password Check\"","# Looking through the entire registry for passwords","Write-Host \"This will take some time. Won't you have a pepsi?\"","$regPath = @(\"registry::\\HKEY_CURRENT_USER\\\", \"registry::\\HKEY_LOCAL_MACHINE\\\")","# Search for the string in registry values and properties","foreach ($r in $regPath) {","(Get-ChildItem -Path $r -Recurse -Force -ErrorAction SilentlyContinue) | ForEach-Object {","    $property = $_.property","    $Name = $_.Name","    $property | ForEach-Object {","      $Prop = $_","      $regexSearch.keys | ForEach-Object {","        $value = $regexSearch[$_]","        if ($Prop | Where-Object { $_ -like $value }) {","          Write-Host \"Possible Password Found: $Name\\$Prop\"","          Write-Host \"Key: $_\" -ForegroundColor Red","        }","        $Prop | ForEach-Object {   ","          $propValue = (Get-ItemProperty \"registry::$Name\").$_","          if ($propValue | Where-Object { $_ -like $Value }) {","            Write-Host \"Possible Password Found: $name\\$_ $propValue\"","          }","        }","      }","    }","  }","  if ($TimeStamp) { TimeElapsed }","  Write-Host \"Finished $r\"","}"],"stylingDirectives":[[{"start":0,"end":2,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":9,"cssClass":"pl-c"},{"start":0,"end":9,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c1"},{"start":1,"end":9,"cssClass":"pl-k"}],[{"start":0,"end":52,"cssClass":"pl-c"}],[{"start":0,"end":12,"cssClass":"pl-c"},{"start":0,"end":12,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c1"},{"start":1,"end":12,"cssClass":"pl-k"}],[{"start":0,"end":112,"cssClass":"pl-c"}],[{"start":0,"end":8,"cssClass":"pl-c"},{"start":0,"end":8,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c1"},{"start":1,"end":8,"cssClass":"pl-k"}],[{"start":0,"end":78,"cssClass":"pl-c"}],[{"start":0,"end":15,"cssClass":"pl-c"}],[{"start":0,"end":0,"cssClass":"pl-c"}],[{"start":0,"end":53,"cssClass":"pl-c"}],[{"start":0,"end":22,"cssC